import React, {useState} from 'react';
import "./_header.scss";

import youtube from "../Assets/youtube.svg"
import instagram from "../Assets/instagram.svg"
import motorcycle from "../Assets/motorcycle-solid.svg"

const Header = () => {

    const [animation,setAnimation] = useState("shake")
    const [animationDuration,setAnimationDuration] = useState("0.8s")
    const [animationDirection,setAnimationDirection] = useState("alternate-reverse")
    const [animationTimingFunction,setAnimationTimingFunction] = useState("linear")
    const [animationIterationCount,setAnimationIterationCount] = useState("infinite")

    const changeAnimation = (motorcycle1,motorcycle2) => {
        setDisplay1(motorcycle1)
        // setDisplay2(motorcycle2)
    }
    // <Keyframes name="move" from={{ left: "0" }} to={{ left: "350px" }} />

    return (
        <>
        <header className="header">
            <div className="header_container container">
                <div className="header_box">
                    <h1 className="header_logo logo">MotoBlog</h1>
                    <img className="header_logo_motorcycle" src={motorcycle} alt="motorcycle"
                         style={{
                             display:display1,
                         }}
                    />
                </div>
                <ul className="header_navi">
                    <li><a onMouseEnter={() => changeAnimation( "none","block")}
                           onMouseLeave={() => changeAnimation( "block","none")}
                        href="/" className="header_navi_link">GLOWNA</a></li>
                    <li><a href="index" className="header_navi_link">FILMY</a></li>
                    <li><a href="index" className="header_navi_link">KRAJE</a></li>
                    <li><a href="index" className="header_navi_link">MAPA</a></li>
                    <li><a href="index" className="header_navi_link">O MNIE</a></li>
                </ul>
                <div className="header_socialmedia">
                    <a href="https://www.youtube.com/channel/UC4EcLfZbiW9GIQYlqPTSGGg"><img src={youtube} alt="Youtube"/></a>
                    <a href="#"><img src={instagram} alt="Instagram"/></a>
                </div>
            </div>
        </header>
            <div className="header_road">
                <div className="header_road_line"></div>
            </div>
        </>
    );
};

export default Header;
